import React, { useState, useEffect } from "react";

export default function Services() {


  const services = [
    "PREVENTIVE MAINTENANCE SERVICE",
    "REFRIGERATION SYSTEM REPAIR",
    "BODY AND COLLISION REPAIR",
    "PRE-COOLING"
  ];



  return (


    <>
      <div className="absolute h-full w-full left-0 z-0">
        <img
          src={"attachment/services.jpg"}
          alt=""
          className="object-cover md:w-full h-full">
        </img>
      </div>

      <div className="lg:w-1/2 flex h-full lg:mt-24 opacity-90 outline outline-blue-800
      bg-gradient-to-r from-blue-600 via-blue-500 to-blue-600 
        text-white w-full flex flex-col relative h-full z-10">

        <div className="w-full flex items-center justify-center">
          <h1 className="text-3xl font-bold uppercase tracking-wide">
            OUR SERVICE
          </h1>
        </div>




        {services.map((item, index) => {
          const gridRow = 3;
          return (
            <>
              <div className="w-full flex flex-col lg:flex-row outline h-[25%]">
                <div className="flex w-full">
                  <div className="flex w-full mx-auto items-center">
                    <img src="attachment/logo.png" alt="" className="object-cover h-[50px] mx-auto col-span-1 col-start-1" />
                  </div>
                </div>
                <div className="flex w-full p-5 flex-col gap-3">
                  <div className="flex flex-row gap-4">
                    <div className="w-full flex flex-col">
                      <h1 className="text-sm/6 font-bold text-white uppercase tracking-wide col-span-3 col-start-2 p-2 align-middle text-left">
                        {item}
                      </h1>
                    </div>
                  </div>
                </div>
              </div>
            </>
          );
        })}
      </div>
    </>
  );
}
